comment_data.body:
各位互拜新年.

@cflw 正继续撰写网络设备自动化脚本这一系列的文章. (非常期待) C++游戏也在继续推进.

@RimoChan 在使用中对[Librian](https://github.com/RimoChan/Librian)进行持续改进. 打算对深度学习进行探索. (期待相关文章). 对[汉化报错信息](https://zhuanlan.zhihu.com/p/56411693)有共鸣 (希望继续交流). 提及[从SO导入代码的工具](https://github.com/drathier/stack-overflow-import)

qq@fool 提出想法: 对第三方库提取中文标签, 使开发者能够更方便的检索, 与论文关键词机制类似. 建议选一个实例进行尝试后看看效果.

qq@一颗小韭菜 qq@eval 旁听

@nobodxbodon 参与了周蟒作者的[中文版TS简体版](https://github.com/gasolin/lingascript/tree/master/src/cn)的测试和文档. 另打算先基于[之前的尝试](https://github.com/program-in-chinese/study/tree/master/1-%E5%9F%BA%E7%A1%80/%E6%8E%A7%E5%88%B6%E5%8F%B0)继续完善, 完成尽可能多的编译/警示信息的中文化.

无论是否与会, 欢迎补充.
